import "./index.css";
import profileone from "../profilesimages/Brenda.jpg";
import profiletwo from "../profilesimages/Lavender.jpg";
import profilethree from "../profilesimages/Valentine.jpg";
import profilefour from "../profilesimages/Nakato.jpg";
import profilefive from "../profilesimages/Faith.jpg";

const Team = () => {
  return (

      <div className="Meetus">

        <div className="title">
        <h2 className="meetus">Meet The Team</h2>
        </div>




          <div className="team">
          <div className="nakato">
          <img src={profilefour} alt="Nakato" className="images" />

          <div>
            <h4>Nakato Musana</h4>
            {/* <p>Data Analyst</p> */}
          </div>
          </div>

          <div className="valentine">
          <img src={profilethree} alt="Valentine" className="team images" />
          <div>
            <h4>Valentine Nkatha</h4>
            {/* <p>Android Developer</p> */}
            </div>
          </div>
          <div className="lavender">
            <img src={profiletwo} alt="Lavender" className="team images" />
            <div>
              <h4>Lavender Anyango</h4>
              {/* <p>Software Developer</p> */}
            </div>
           </div> 

          <div className="brenda">
          <img src={profileone} alt="Brenda" className="team images" />
          <div>
            <h4>Brenda Khamali</h4>
            {/* <p>Designer</p> */}
            </div>
          </div>

          <div className="faith">
          <img src={profilefive} alt="Faith" className="team images" />
          <div>
            <h4>Faith Wanyoike</h4>
            {/* <p>Product Manager</p> */}
          </div>
        </div>
        </div>
       </div>

  );
};
export default Team;
